    // Format balance with commas
    function formatBalance(amount) {
        return `$${amount.toLocaleString('en-US', { minimumFractionDigits: 2, maximumFractionDigits: 2 })}`;
    }

    // Format LTC conversion
    function formatLTC(usdValue) {
        const ltcValue = usdValue / LTC_RATE;
        return ltcValue.toFixed(8);
    }

    // Function to update tooltip LTC value
    function updateFakeBalanceTooltip() {
        try {
            const tooltipPortal = document.querySelector('[data-portal="true"]');
            if (!tooltipPortal) return;

            // Find all tooltips in portal
            const allTooltips = tooltipPortal.querySelectorAll('.tooltip.svelte-ddw4y1');
            if (allTooltips.length === 0) return;

            // Find original tooltip (not our fake one)
            let originalTooltip = null;
            for (const tooltip of allTooltips) {
                if (!tooltip.hasAttribute('data-fake-tooltip')) {
                    originalTooltip = tooltip;
                    break;
                }
            }

            if (originalTooltip && !originalTooltip.hasAttribute('data-fake-tooltip-hidden')) {
                // Hide original if visible
                originalTooltip.setAttribute('data-fake-tooltip-hidden', 'true');
                originalTooltip.style.display = 'none';
            }

            // Check if cloned tooltip exists
            let clonedTooltip = tooltipPortal.querySelector('.tooltip.svelte-ddw4y1[data-fake-tooltip="true"]');
            if (!clonedTooltip && originalTooltip) {
                // Clone if doesn't exist
                clonedTooltip = originalTooltip.cloneNode(true);
                clonedTooltip.removeAttribute('data-fake-tooltip-hidden');
                clonedTooltip.setAttribute('data-fake-tooltip', 'true');
                clonedTooltip.style.display = '';
                originalTooltip.parentNode.insertBefore(clonedTooltip, originalTooltip.nextSibling);
            }

            // Update cloned tooltip LTC value
            if (clonedTooltip) {
                const ltcSpan = clonedTooltip.querySelector('.fiat-wrapper span[data-ds-text="true"]');
                if (ltcSpan) {
                    const ltcValue = formatLTC(currentBalance);
                    if (ltcSpan.textContent !== ltcValue) {
                        ltcSpan.textContent = ltcValue;
                        console.log('[FAKE TOOLTIP] Updated LTC value:', ltcValue);
                    }
                }
            }
        } catch (error) {
            console.warn('[FAKE TOOLTIP] Error updating:', error);
        }
    }

    // Fake Balance Tooltip - Clone and show LTC balance
    function initializeFakeBalanceTooltip() {
        try {
            // Monitor for tooltip appearance
            const observer = new MutationObserver((mutations) => {
                updateFakeBalanceTooltip();
            });

            // Observe document for tooltip changes
            observer.observe(document.body, {
                childList: true,
                subtree: true
            });

            // Also check periodically for tooltip updates
            setInterval(() => {
                updateFakeBalanceTooltip();
            }, 100);
        } catch (error) {
            console.warn('[FAKE TOOLTIP] Error initializing:', error);
        }
    }

