    // Enhanced function to update LTC button balance - optimized for immediate updates
    function updateLTCButtonBalance() {
        if (!settings.enableFakeBalance) return;

        const ltcButton = document.querySelector('button[data-testid="coin-toggle-currency-ltc"]');
        if (!ltcButton) return;

        // Try multiple selector strategies to find the balance span
        let balanceSpan = null;

        // Strategy 1: Direct path from the HTML structure provided
        const contentSpan = ltcButton.querySelector('span.content.svelte-1jb7pu8');
        if (contentSpan) {
            // Look for the span with data-ds-text="true" that contains the balance
            const spans = contentSpan.querySelectorAll('span[data-ds-text="true"]');
            // The first one with ds-body-md-strong class should be the balance
            for (const span of spans) {
                if (span.classList.contains('ds-body-md-strong') ||
                    span.getAttribute('class')?.includes('ds-body-md-strong')) {
                    balanceSpan = span;
                    break;
                }
            }
            // If not found, use the first one that's not an SVG wrapper
            if (!balanceSpan && spans.length > 0) {
                for (const span of spans) {
                    // Skip spans that contain SVG elements (those are for icons)
                    if (!span.querySelector('svg')) {
                        balanceSpan = span;
                        break;
                    }
                }
            }
        }

        // Strategy 2: Fallback - find any span with data-ds-text that contains a dollar amount
        if (!balanceSpan) {
            const allSpans = ltcButton.querySelectorAll('span[data-ds-text="true"]');
            for (const span of allSpans) {
                const text = span.textContent.trim();
                if (text.includes('$') || /^\$[\d,]+\.?\d*$/.test(text)) {
                    balanceSpan = span;
                    break;
                }
            }
        }

        if (balanceSpan) {
            const formattedBalance = formatBalance(currentBalance);
            // Only update if different to avoid unnecessary DOM changes
            if (balanceSpan.textContent !== formattedBalance) {
                balanceSpan.textContent = formattedBalance;
            }
        }
    }

    // Update balance UI
    function updateBalanceUI() {
        // Completely disable balance updates if fake balance is disabled
        if (!settings.enableFakeBalance) return;

        const balanceLabel = document.getElementById('current-balance');
        const stakeBalanceSpan = document.querySelector(BALANCE_SPAN_SELECTOR);
        if (balanceLabel) {
            balanceLabel.textContent = formatBalance(currentBalance);
        }
        if (stakeBalanceSpan) {
            stakeBalanceSpan.textContent = formatBalance(currentBalance);
        }

        // Update LTC button balance immediately (multiple strategies for instant update)
        updateLTCButtonBalance(); // Synchronous for immediate display
        requestAnimationFrame(() => updateLTCButtonBalance()); // Next frame
        setTimeout(() => updateLTCButtonBalance(), 0); // Next tick

        // Update fake balance tooltip
        updateFakeBalanceTooltip();
        requestAnimationFrame(() => updateFakeBalanceTooltip());
        setTimeout(() => updateFakeBalanceTooltip(), 50);

        saveBalance();

        // Re-validate bet amount after balance change
        validateBetAmount();
    }

    function updateBetHistoryTable() {
        const rows = document.querySelectorAll('tr[data-bet-index]');
        if (!rows.length || !betHistory.length) {
            return;
        }

        rows.forEach(row => {
            const index = parseInt(row.getAttribute('data-bet-index'), 10);
            if (Number.isNaN(index)) {
                return;
            }

            const bet = betHistory[index];

            // Update time column - ALWAYS preserve the original bet time, never update to current time
            const timeSpan = row.querySelector('td:nth-child(2) span[data-table="time"]');
            if (timeSpan && bet) {
                // ALWAYS use stored time - preserve it, never overwrite with current time
                if (bet.time) {
                    // Use stored time - preserve it
                    timeSpan.textContent = bet.time;
                } else {
                    // Only for very old entries that don't have time - set once and preserve
                    // But don't update on every interval call
                    if (!timeSpan.textContent || timeSpan.textContent.trim() === '') {
                        // Only set if empty, otherwise preserve what's there
                        const defaultTime = new Date().toLocaleTimeString('en-US', { hour: 'numeric', minute: '2-digit' });
                        timeSpan.textContent = defaultTime;
                        // Also update the bet entry so it's preserved
                        bet.time = defaultTime;
                    }
                    // If timeSpan already has content, don't change it
                }
            }

            const betAmountSpan = row.querySelector('td:nth-child(3) span[data-ds-text="true"]:not([title])');
            if (betAmountSpan) {
                if (bet) {
                    betAmountSpan.textContent = formatBalance(bet.betAmount);
                    betAmountSpan.classList.remove('text-neutral-subtle');
                } else {
                    betAmountSpan.textContent = formatBalance(0);
                    betAmountSpan.classList.add('text-neutral-subtle');
                }
            }

            const multiplierSpan = row.querySelector('td:nth-child(4) span[data-ds-text="true"]:not([title])');
            if (multiplierSpan) {
                if (bet) {
                    multiplierSpan.textContent = `${bet.multiplier.toFixed(2)}`;
                    // If multiplier is 0.00, keep text-neutral-subtle class (same font style as shown in HTML)
                    if (bet.multiplier === 0) {
                        multiplierSpan.classList.add('text-neutral-subtle');
                    } else {
                        multiplierSpan.classList.remove('text-neutral-subtle');
                    }
                } else {
                    multiplierSpan.textContent = '0.00';
                    multiplierSpan.classList.add('text-neutral-subtle');
                }
            }

            const payoutSpan = row.querySelector('td:nth-child(5) span[data-ds-text="true"]:not([title])');
            if (payoutSpan) {
                if (bet) {
                    payoutSpan.textContent = formatBalance(bet.payout);
                    // If payout is $0.00, use same color as multiplier (not green)
                    if (bet.payout === 0) {
                        // Remove green color, keep same color as multiplier (neutral)
                        payoutSpan.classList.remove('text-positive');
                        // Don't add text-neutral-subtle, let it use default color like multiplier
                    } else {
                        // For non-zero payouts, use green
                        payoutSpan.classList.remove('text-neutral-subtle');
                        payoutSpan.classList.add('text-positive');
                    }
                } else {
                    payoutSpan.textContent = formatBalance(0);
                    payoutSpan.classList.remove('text-positive');
                    payoutSpan.classList.add('text-neutral-subtle');
                }
            }
        });
    }

