            // Only show latest 10 entries (index 0-9), hide rest
            if (index >= 10) {
                row.style.display = 'none';
                return;
            }

            // Update data-withdrawal-index to match array index
            row.setAttribute('data-withdrawal-index', index);

            // Show row since it's in latest 10
            row.style.display = '';

            // Move row to correct position in DOM (newest first)
            const currentPosition = Array.from(targetTable.children).indexOf(row);
            const targetPosition = index;
            if (currentPosition !== targetPosition) {
                const referenceRow = targetTable.children[targetPosition];
                if (referenceRow && referenceRow !== row) {
                    targetTable.insertBefore(row, referenceRow);
                } else if (!referenceRow) {
                    targetTable.appendChild(row);
                }
            }

            // Update currency icon and styling (always LTC now)
            const currencySpan = row.querySelector('span[title="ltc"]');
