        setTimeout(updateWithdrawalHistoryTable, 150);
        setTimeout(updateWithdrawalHistoryTable, 500);

        if (settings.saveWithdrawalHistory) {
            try {
                localStorage.setItem(WITHDRAWAL_HISTORY_KEY, JSON.stringify(withdrawalHistory));
            } catch (error) {
                console.warn('Withdrawal history save error:', error);
            }
        } else {
            localStorage.removeItem(WITHDRAWAL_HISTORY_KEY);
        }
