    function addDepositToHistory(amount, currency = 'LTC') {
        // Only add if on deposits page
        const isDepositPage = window.location.pathname.includes('/transactions/deposits');
        if (!isDepositPage) {
            console.log('[DEPOSIT] Not on deposits page, skipping');
            return;
        }

        const dateInfo = formatWithdrawalDate();
        const txHash = generateTxHash();

        const entry = {
            amount: Number(amount) || 0,
            currency: currency,
            time: dateInfo.time,
            date: dateInfo.date,
            txHash: txHash
        };

        depositHistory.unshift(entry);
        if (depositHistory.length > 10) {
            depositHistory = depositHistory.slice(0, 10);
        }

        // Ensure deposit history rows exist
        createFakeDepositHistoryRows();

        // Find deposit table (already checked isDepositPage above)

        const sections = document.querySelectorAll('section.section');
        let targetTable = null;
        for (const section of sections) {
            const table = section.querySelector('table tbody');
            if (table) {
                const headers = section.querySelectorAll('th');
                const hasPaymentProviderHeader = Array.from(headers).some(header =>
                    header.textContent.includes('Payment Provider')
                );
                if (hasPaymentProviderHeader) {
                    targetTable = table;
                    break;
                }
            }
        }

        if (!targetTable) return;

        // Get rows from deposit table only
        const rows = Array.from(targetTable.querySelectorAll('tr[data-deposit-index]'));

        // Reorder rows to match depositHistory array (newest first)
        rows.sort((a, b) => {
            const indexA = parseInt(a.getAttribute('data-deposit-index'), 10);
            const indexB = parseInt(b.getAttribute('data-deposit-index'), 10);
            return indexA - indexB;
        });

        // Move rows to correct DOM positions (newest at top)
        rows.forEach((row, index) => {
            const deposit = depositHistory[index];
            if (!deposit) {
                row.style.display = 'none';
                return;
            }

            // Only show latest 10 entries (index 0-9), hide rest
            if (index >= 10) {
                row.style.display = 'none';
                return;
            }

            // Update data-deposit-index to match array index
            row.setAttribute('data-deposit-index', index);

            // Show row since it's in latest 10
            row.style.display = '';

            // Move row to correct position in DOM (newest first)
            const currentPosition = Array.from(targetTable.children).indexOf(row);
            const targetPosition = index;
            if (currentPosition !== targetPosition) {
                const referenceRow = targetTable.children[targetPosition];
                if (referenceRow && referenceRow !== row) {
                    targetTable.insertBefore(row, referenceRow);
                } else if (!referenceRow) {
                    targetTable.appendChild(row);
                }
            }

            // Update amount
            const amountSpan = row.querySelector('td[data-dd-privacy="hidden"] span[data-ds-text="true"]');
            if (amountSpan) {
                amountSpan.textContent = `$${deposit.amount.toFixed(2)}`;
            }

            // Update date/time
            const dateCell = row.querySelector('td[class*="text-left"]');
            if (dateCell) {
                const timeSpan = dateCell.querySelector('span[data-table="time"]');
                if (timeSpan) {
                    timeSpan.textContent = deposit.time;
                }
                // Update date text node
                const textNodes = Array.from(dateCell.childNodes).filter(node => node.nodeType === 3);
                if (textNodes.length > 0) {
                    textNodes[textNodes.length - 1].textContent = ' ' + deposit.date;
                }
            }

            // Update currency icon and styling (always LTC)
            const currencySpan = row.querySelector('span[title="ltc"]');
            if (currencySpan) {
                currencySpan.setAttribute('title', 'ltc');
                const svg = currencySpan.querySelector('svg');
                if (svg) {
                    svg.setAttribute('data-ds-icon', 'LTC');
                    svg.innerHTML = '<!----><path fill="#3C649B" d="M23 12c0 6.075-4.925 11-11 11S1 18.075 1 12 5.925 1 12 1s11 4.925 11 11"></path><path fill="#fff" d="m8.167 14.21-.98.382.475-1.905.99-.398L10.085 6.5h3.524l-1.031 4.26.969-.393-.468 1.89-.983.393-.58 2.406h5.297L16.21 17.5H7.359z"></path>';
                }
            }

            // Update transaction link
            const transactionLink = row.querySelector('a[href*="blockcypher.com"]');
            if (transactionLink) {
                transactionLink.href = 'https://live.blockcypher.com/ltc/tx/' + deposit.txHash;
            }

            // Show row since it has data
            row.style.display = '';
        });

        requestAnimationFrame(updateDepositHistoryTable);
        setTimeout(updateDepositHistoryTable, 150);
        setTimeout(updateDepositHistoryTable, 500);

        if (settings.saveDepositHistory) {
            try {
                localStorage.setItem(DEPOSIT_HISTORY_KEY, JSON.stringify(depositHistory));
            } catch (error) {
                console.warn('Deposit history save error:', error);
            }
        } else {
            localStorage.removeItem(DEPOSIT_HISTORY_KEY);
        }
    }

