                    // Generate new locations
                    const tileIndices = Array.from({ length: totalTiles }, (_, i) => i);
                    // Shuffle array
                    for (let i = tileIndices.length - 1; i > 0; i--) {
                        const j = Math.floor(Math.random() * (i + 1));
                        [tileIndices[i], tileIndices[j]] = [tileIndices[j], tileIndices[i]];
                    }
                    // First numSafe indices are safe, rest are bombs
                    safeIndices = new Set(tileIndices.slice(0, numSafe));
                    const bombIndices = new Set(tileIndices.slice(numSafe));

                    // Store for later use
                    preDecidedSafeLocations = safeIndices;
                    preDecidedBombLocations = bombIndices;
                    const bombTiles = Array.from(bombIndices).map(i => i + 1).sort((a, b) => a - b);
