    function removePredictor() {
        if (radarContainer) {
            radarContainer.remove();
            radarContainer = null;
        }
        if (telegramBadge) {
            telegramBadge.remove();
            telegramBadge = null;
        }
        document.querySelectorAll(".seer-aim, .bomb-indicator").forEach((el) => el.remove());
    }

    function updatePredictorName() {
        const titleEl = document.getElementById('predictor-title');
        if (titleEl) {
            titleEl.textContent = settings.customName;
        }
    }

    function updatePredictorColor() {
        if (!radarContainer) return;
        const btn = radarContainer.querySelector('button');
        if (btn) {
            btn.style.background = `linear-gradient(135deg, ${settings.predictorColor} 0%, ${adjustColor(settings.predictorColor, -20)} 100%)`;
            btn.style.borderColor = `${adjustColor(settings.predictorColor, 30, 0.5)}`;
            btn.style.boxShadow = `0 4px 20px ${hexToRgba(settings.predictorColor, 0.3)}, inset 0 1px 0 rgba(255,255,255,0.1)`;
        }
        // Update CSS animations
        const styleEl = document.getElementById('predictor-styles');
        if (styleEl) {
            styleEl.innerHTML = styleEl.innerHTML.replace(/filter: drop-shadow\([^)]+\)/g, (match) => {
                return match.replace(/#[0-9a-fA-F]{6}|rgba?\([^)]+\)/g, settings.predictorColor);
            });
        }
    }

    function updateTelegramBadge() {
        if (!telegramBadge) return;
        const TELEGRAM_HANDLE = settings.telegramTagName || '@grafitstake';
        const telegramUsername = TELEGRAM_HANDLE.replace('@', '');
        const TELEGRAM_LINK = `https://t.me/${telegramUsername}`;

        const linkEl = telegramBadge.querySelector('a');
        if (linkEl) {
            linkEl.href = TELEGRAM_LINK;
        }

        const spanEl = telegramBadge.querySelector('span');
        if (spanEl) {
            spanEl.textContent = TELEGRAM_HANDLE;
        }

        const techEl = telegramBadge.querySelector('div');
        if (techEl && techEl.textContent.includes('Tech')) {
            techEl.textContent = ` ${settings.customName} Tech `;
        }
    }

