        // Watch for new notifications using MutationObserver
        const observer = new MutationObserver((mutations) => {
            mutations.forEach((mutation) => {
                mutation.addedNodes.forEach((node) => {
                    if (node.nodeType === 1) { // Element node
                        // Check if the added node is a notification
                        if (node.matches && node.matches('[data-testid="notification"]')) {
                            checkAndRemoveNotification(node);
                        }
                        // Also check for notifications inside the added node
                        const notifications = node.querySelectorAll ? node.querySelectorAll('[data-testid="notification"]') : [];
                        notifications.forEach(notification => {
                            checkAndRemoveNotification(notification);
                        });
                    }
                });
            });
        });

        // Start observing the document body for new notifications
        observer.observe(document.body, {
            childList: true,
            subtree: true
        });

